import { createSlice } from "@reduxjs/toolkit";

const initialState = {
  productList: [],
};

const productSlice = createSlice({
  name: "products",
  initialState,
  reducers: {
    productList: (state) => {},
  },
});

export default productSlice.reducer;
export const { productList } = productSlice.actions;
